package com.example.luxdivetravel.presentation.boat

import android.os.Bundle
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.fragment.app.Fragment
import androidx.navigation.NavController
import androidx.navigation.Navigation
import androidx.recyclerview.widget.LinearLayoutManager
import com.example.domain.domain.models.Boat
import com.example.luxdivetravel.R
import com.example.luxdivetravel.databinding.FragmentBoatListContentBinding
import com.example.luxdivetravel.presentation.adapters.RecyclerViewAdapter
import com.example.luxdivetravel.viewmodel.MainViewModel
import org.koin.androidx.viewmodel.ext.android.sharedViewModel


class BoatListContent : Fragment() {
    private var _binding: FragmentBoatListContentBinding? = null
    private var navController: NavController? = null
    private val binding get() = _binding!!
    private val sharedMainViewModel by sharedViewModel<MainViewModel>()

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View {
        _binding = FragmentBoatListContentBinding.inflate(inflater)
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        navController = Navigation.findNavController(view)
        //TODO : Get pictures from the dataBase
        val boatList: List<Boat> = listOf(
            Boat(
                "first",
                "etc_0",
                0,
                "data:image/jpeg;base64,",
                ArrayList<String>(10)
            ), Boat(
                "second",
                "etc_1",
                1,
                "data:image/jpeg;base64,",
                ArrayList<String>(10)
            ), Boat(
                "third",
                "etc_2",
                2,
                "data:image/jpeg;base64,",
                ArrayList<String>(10)
            ), Boat(
                "fourth",
                "etc_3",
                3,
                "data:image/jpeg;base64,",
                ArrayList<String>(10)
            ), Boat(
                "fifth",
                "etc_4",
                4,
                "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ_ex9ai2rqxH7gj7b9U8unCQaojrcPzNqOHg&usqp=CAU",
                ArrayList<String>(10)
            ),
            Boat(
                "sixth",
                "etc_5",
                5,
                "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRSM5lv7VHvSOMkUyL0aJ7NzusE7wbrdChrQA&usqp=CAU",
                ArrayList<String>(10)
            )
        )
        //TODO : Get pictures from the dataBase
        val recyclerViewAdapter = RecyclerViewAdapter(boatList)
        recyclerViewAdapter.onItemClick = {
            navController!!.navigate(R.id.action_boatList_to_boatInfo)
            sharedMainViewModel.pushChoice(it.name)
        }
        binding.boatList.layoutManager = LinearLayoutManager(this.context)
        binding.boatList.adapter = recyclerViewAdapter
    }

    override fun onDestroy() {
        super.onDestroy()
        _binding = null
    }

}